import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header';
import IrisPredictForm from './components/IrisPredictForm';
import ResultPredictForm from './components/ResultPredictForm';

const App = () => {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<div><h1>Welcome to the Model Prediction App</h1></div>} />
        <Route path="/iris-model" element={<IrisPredictForm modelType="iris_model" />} />
        <Route path="/result-model" element={<ResultPredictForm modelType="result_model" />} />
        <Route path="/dynamic/:id" element={<DynamicComponent />} />
      </Routes>
    </Router>
  );
};

const DynamicComponent = () => {
  const { id } = useParams();

  return (
    <div>
      <h1>Dynamic Component</h1>
      <p>ID: {id}</p>
    </div>
  );
};

export default App;
